    [Vak9]      NVARCHAR (4)  NULL,
    [Vak10]     NVARCHAR (4)  NULL,
    [Vak11]     NVARCHAR (4)  NULL,
    [Vak12]     NVARCHAR (4)  NULL,
    [Vak13]     NVARCHAR (4)  NULL,
    [Vak14]     NVARCHAR (4)  NULL,
    [Vak15]     NVARCHAR (4)  NULL,
    [Vak16]     NVARCHAR (4)  NULL,
